Professor Jessica Jaymes is at her desk doing her work when her student Bill drops a bombshell on her: he caught his track team girlfriend in bed with the track coach, who just happens to be Professor James's fiancee. The college educator can't believe what she's hearing, but after it's all said and done, she's ready to move on, real quick! So quick that she has her student Bill help her undress and shoves her big tits in his face! Ol' boy Bill may be heartbroken, but he's happy as a clam when Jessica's is in his face! The student-teacher fornication meeting is a success, as the hearbroken duo help one another move on to greener pastures. The End.
